import { useHistory } from "react-router-dom";

function Navbar() {
  let history = useHistory();

  const redirect = () => {
    history.push(<Footer />);
  };
  return (
    <div className="Navbar">
      <div className="Navbar_left">
        <img src={edtech} alt="" />
        <h3>EVIRT EDTECH LIMITED</h3>
      </div>
      <div className="Navbar_right">
        <Link
          style={{
            color: "white",
